INSERT INTO `konfigurasi_web_f` (`Id`, `spp`, `edited`) VALUES
(68, ' <b>SYARAT PENDAFTARAN</b>;\r\n1. Lulusan SMA / MA / SMK.;\r\n2. Telah memiliki Ijazah dan SKHUN SLTA sederajat atau SKL bagi lulusan 2021.;\r\n3. Menentukan pilihan kuliah REGULER atau NON REGULER.;\r\n4. Mengikuti seluruh prosedur pendaftaran yang telah ditentukan oleh panitia.;;\r\n\r\n<b><p class=\"d-inline text-danger\">Catatan :</p><p class=\"d-inline\"></b>;\r\n<span  id=\"PP\">- Kuliah Reguler adalah kuliah aktif atau kuliah sesuai jadwal umum dengan jadwal kuliah Senin - Jumat.;</span>\r\n<span>- Kuliah Non Reguler adalah Kuliah Efektif dengan jadwal kuliah 2 hari dalam sepekan, Jumat-Sabtu / Sabtu-Ahad.</span>\r\n\r\n<hr>;\r\n\r\n<b>PROSEDUR PENDAFTARAN</b>;\r\n1. Telah membaca dan memahami persyaratan pendaftaran calon mahasiswa baru.;\r\n2. Melakukan registrasi dengan mengisi biodata peserta di <p class=\"d-inline text-primary\"> <a href=\"https://lipmb.umbulukumba.ac.id/registrasi\">https://lipmb.umbulukumba.ac.id/registrasi</a>.</p><p class=\"d-inline\">;\r\n3. Membayar biaya pendaftaran sebesar Rp. 150.000 untuk pilihan kuliah Reguler, dan  Rp. 200.000 untuk pilihan kuliah Non Reguler.;\r\n4. Melakukan konfirmasi pembayaran pendaftaran kepada panitia di No WA +62 852-4000-5373\r\nuntuk mendapatkan username dan password login pendaftaran.;\r\n5. Menggunggah Foto beserta menentukan Pilihan Kuliah dan Program Study melalui akun yang telah didapatkan dari panitia di <p class=\"d-inline text-primary\"><a href=\"https://lipmb.umbulukumba.ac.id/login-peserta\">https://lipmb.umbulukumba.ac.id/login-peserta</a>.</p><p class=\"d-inline\">;\r\n6. Unduh kartu test peserta.;\r\n7. Hasil seleksi Calon mahasiswa dapat dilihat melalui laman <a href=\"https://lipmb.umbulukumba.ac.id/pengumuman\">https://lipmb.umbulukumba.ac.id/pengumuman</a>.;\r\n8. Calon Mahasiswa Baru yang sudah mendaftar dan dinyatakan belum lulus dapat mendaftar di gelombang berikutnya.;;\r\n\r\n<b></p> <p class=\"d-inline text-danger\">Catatan :</p><p class=\"d-inline\"></b>;\r\n- Transfer dapat dilakukan dari BANK manapun.;\r\n- Pembayaran Biaya Pendaftaran melalui Bank Syariah Mandiri No. Rek 150.620.1302 a.n Stkip Muhammadiyah Bulukumba.;\r\n- Kode BSM 451 (Khusus yang transfer dari Non BANK Mandiri Syariah).;\r\n- Jika transfer menggunakan via Non Teller (ATM, Link, Bangkin, Mobile) maka tidak dianjurkan menggunakan selain dari pada milik peserta atau milik Orang Tua.;\r\n- Konfirmasi pembayaran tidak meski menggunakan No HP dari Peserta.;\r\n\r\n<hr>;\r\n\r\n<b></p> <p class=\"d-inline\">PERSYARATAN FILE FOTO CALON MAHASIWA BARU :</p><p class=\"d-inline\"></b>;\r\n- Foto berformat .JPG atau .PNG;\r\n- Size foto Max 500 KB.;\r\n- Ukuran foto 3x4.;\r\n- Foto dengan latar merah.;;\r\n\r\n<b></p> <p class=\"d-inline text-danger\">Contoh Foto Calon Mahasiswa Baru :</p><p class=\"d-inline\"></b>;\r\n<img src=\"../plugins/assets/image/df1.jpg\" class=\"img-thumbnail\" width=\"120\">\r\n\r\n<hr>;\r\n\r\n<b>FORMAT KONFIRMASI PEMBAYARAN BIAYA PENDAFTARAN :</b>;\r\nSalam.;\r\nNama : (Nama Anda);\r\nNIK : (Nik Anda);\r\nNo HP : (No HP Anda);\r\n(Lampiran File Slip Pembayaran);;\r\n\r\nContoh :;\r\nAssalamualaikum Warahmatullahi Wabaraqatuh.;\r\nNama : Khaeril Maswal Zaid;\r\nNIK : 7302012121212121;\r\nNo HP : 085343652494;\r\n(Lampiran File Slip Pembayaran);;\r\n\r\n<a href=\"https://api.whatsapp.com/send?phone=6285398518656&text=Assalamualaikum%20Warahmatullahi%20Wabaraqatuh.%0A%0ASaya%20calon%20mahasiswa%20baru%20*Universitas%20Muhammadiyah%20Bulukumba*%20mau%20melakukan%20komfirmasi%20pembayaran%20pendaftaran%20sebesar%20*150.000*.%0A%0A_Dengan%20identitas%20:_%0ANama%20%20%20:%20(Ketik%20nama%20anda)%0ANIK%20%20%20%20%20%20%20:%20(Ketik%20NIK%20anda)%0ANo%20Hp%20%20:%20(Ketik%20No%20Hp%20anda)%0A%0A@LIPMB-Team\">Atau Klik disini!</a>', 'Khaeril Maswal Zaid');
